# Function to get prime factors of a number
def prime_factors(n):
    factors = {}
    # Divide by 2 until n is odd
    while n % 2 == 0:
        if 2 not in factors:
            factors[2] = 0
        factors[2] += 1
        n //= 2
    # n must be odd at this point, so we can skip one element (Note i = i +2)
    for i in range(3, int(n**0.5) + 1, 2):
        # While i divides n, store i and divide n
        while n % i == 0:
            if i not in factors:
                factors[i] = 0
            factors[i] += 1
            n //= i
    # If n is a prime greater than 2
    if n > 2:
        factors[n] = 1
    return factors

